import React from "react";
import Toast from "react-bootstrap";

export default function CourierList({ couriers }) {
  function renderCouriers() {
    return couriers.map((courier, i) => {
      return (
        <div>
          <ul>
            <li key={i}><h4>Name</h4> {courier.name}</li>
            <li key={i}><h4>Destination</h4>{courier.destination}</li>
            <li key={i}><h4>Date of Arrival</h4>{courier.date}</li>
          </ul>
        </div>
      );
    });
  }

  return (
    <div>
      <ul>{renderCouriers()}</ul>
    </div>
  );
}
